def evaluate():
    data = request.get_json()
    try:
        result = safe_eval(data['expression'])
        return jsonify({"result": str(result)})
    except Exception as e:
        return jsonify({"error": str(e)}), 400

if __name__ == "__main__":
    app.run(debug=True)

